import React from 'react'
import {Button} from 'react-bootstrap'


const IndQuote = ({quote}) => {



    return (
        <div className="quotes-page">
            <h1>{quote.quote}</h1>
            <h1> - {quote.author}</h1>
            <Button variant="success">Success</Button><Button></Button>
        </div>
    )
}

export default IndQuote
